    false,nt"url": null,nt"notes": "The following is a summarization of biological
    trend information for, and information applicable to, Valentine NWR. Specifically,
    the information addresses recreational fishing and grassland management activities
    and their relationship to the purposes for which the refuge was established. The
    following information is generally contrary to the comments that were received from
    the local Chamber of Commerce, recreational fishery, and ranching interests that
    were well represented at the CMP Scoping Meeting held in Valentine on March 20.
     Also attached is correspondence originating from Dr. Ward Sharp (the first Manager
    of Valentine NWR), Burnie Maurek (Regional Director, USDA-Bureau of Biological Survey)
    and J. M. Merritt (Superintendent Hatcheries, Nebraska Game & Parks Commission),
    regarding the development of a sport fishery in the Marsh Lakes.  Breeding duck
    data and hunter harvest data are displayed in graphical form as well.",nt"owner_org":
